function getRandomOptions(max = 5) {
  const num = Math.floor(Math.random() * max + 1);
  const options = [];
  for (let i = 1; i <= num; i++) {
    options.push({ title: `选项${i}` });
  }
  return options;
}

export const mockData = (num = 1000) => {
  const questions = [];
  for (let i = 1; i <= num; i++) {
    questions.push({
      title: `第${i}题`,
      optionRandom: !!Math.round(Math.random()),
      options: getRandomOptions()
    });
  }
  return { questions };
};

